import React from 'react'
import './footer.css';


export default function Footer() {
    return (
        <div className="footer">
            <p></p>
            <div className="social">
               <a href='https://www.facebook.com/friendsofmeditation' target="_blank"> <i className="fa fa-facebook"></i></a>&nbsp;
               <a href='https://www.instagram.com/friendsofmeditation01/?hl=en' target="_blank"><i className="fa fa-instagram"></i></a>
            </div>
        </div>
    )
}
